import React, { Component } from 'react';


export class Footer extends Component {
    render() {
        return (

            <footer className="footer footer-1 section-info-dark">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12 text-center">
                            <h2 className="hope-make-it">We would love to hear from you! 

If you have any questions or concerns, please contact Kate on:</h2><br/>
                            <h6>Any early questions give us a text <br/>or email
                                at<br/> <a href="mailto:rhyswork@gmail.com">rhyswork@gmail.com</a><br/>
                                <a href="mailto:katesunderland@hotmail.com">katesunderland@hotmail.com</a></h6>
                        </div>
                    </div>
                </div>
            </footer>


        )
    }
}
